(14, '', '<p></p><p><br>It is a long established fact that a reader will be distracted by the <br>readable content of a page when looking at its layout. The point of <br>using Lorem Ipsum is that it has a more-or-less normal distribution of <br>letters, as opposed to using \'Content here, content here\', making it <br>look like readable English. Many desktop publishing packages and web <br>page editors now use Lorem Ipsum as their default model text, and a <br>search for \'lorem ipsum\' will uncover many web sites still in their <br>infancy. Various versions have evolved over the years, sometimes by <br>accident, sometimes on purpose (injected humour and the like)<br><br><br></p><br><p></p>', '78355Lighthouse.jpg', 1, '0892eed21375d44146c8e9a86431967b', '2018-11-15 04:50:01 am', '2018-11-17 05:15:38 am', ''),
(15, '', '<p></p><p><br>It is a long established fact that a reader will be distracted by the <br>readable content of a page when looking at its layout. The point of <br>using Lorem Ipsum is that it has a more-or-less normal distribution of <br>letters, as opposed to using \'Content here, content here\', making it <br>look like readable English. Many desktop publishing packages and web <br>page editors now use Lorem Ipsum as their default model text, and a <br>search for \'lorem ipsum\' will uncover many web sites still in their <br>infancy. Various versions have evolved over the years, sometimes by <br>accident, sometimes on purpose (injected humour and the like)<br><br><br></p><br><p></p>', '14646Chrysanthemum.jpg', 1, 'bc6c44f280706b345005412f1b86670e', '2018-11-15 04:56:03 am', '2018-11-15 05:06:35 am', ''),
(16, '', '<p></p><p></p><p><br>It is a long established fact that a reader will be distracted by the <br>readable content of a page when looking at its layout. The point of <br>using Lorem Ipsum is that it has a more-or-less normal distribution of <br>letters, as opposed to using \'Content here, content here\', making it <br>look like readable English. Many desktop publishing packages and web <br>page editors now use Lorem Ipsum as their default model text, and a <br>search for \'lorem ipsum\' will uncover many web sites still in their <br>infancy. Various versions have evolved over the years, sometimes by <br>accident, sometimes on purpose (injected humour and the like)<br><br><br></p><br><p></p><br><p></p>', '87923Jellyfish.jpg', 1, 'ab152e9622a60012c057634b219a4387', '2018-11-15 05:02:19 am', '2018-11-15 08:12:09 am', ''),
(17, '', '<p>dddddddddddddddd<br></p>', '43994Hydrangeas.jpg', 11, 'e802fa7939f03cdd02e68f6f97393e6b', '2018-11-15 05:11:52 am', '', '2018-12-06 08:34:51 am'),
(18, '', 'But I must explain to you how all this mistaken idea of denouncing \r\npleasure and praising pain was born and I will give you a complete \r\naccount of the system, and expound the actual teachings of the great \r\nexplorer of the truth, the master-builder of human happiness. No one \r\nrejects, dislikes, or avoids pleasure itself, because it is pleasure, \r\nbut because those who do not know how to pursue pleasure rationally \r\nencounter consequences that are extremely painful. Nor again is there \r\nanyone who loves or pursues or desires to obtain pain of itself, because\r\n it is pain, but because occasionally circumstances occur in which toil \r\nand pain can procure him some great pleasure. To take a trivial example,\r\n which of us ever undertakes laborious physical exercise, except to \r\nobtain some advantage from it? But who has any right to find fault with a\r\n man who chooses to enjoy a pleasure that has no annoying consequences, \r\nor one who avoids a pain that produces no resultant pleasure', '53418Tulips.jpg', 1, '04faaf0f5a03b8ba3ec5c0142261c2ab', '2018-11-17 05:30:38 am', '2018-11-17 05:33:04 am', ''),
(19, '  মোঃ রেজাউল হক  ', '<p>\r\nThe standard chunk of Lorem Ipsum used since the 1500s is reproduced \r\nbelow for those interested. Sections 1.10.32 and 1.10.33 from \"de \r\nFinibus Bonorum et Malorum\" by Cicero are also reproduced in their exact\r\n original form, accompanied by English versions from the 1914 \r\ntranslation by H. Rackham.\r\n\r\n<br></p>', '2.JPG', 13, 'f78467f0aa4361884073ece84496c458', '2018-11-17 05:31:15 am', '', '2018-12-06 07:10:38 am'),
(20, 'MD. GOLAM MOKTADIR', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', '72825Picture.jpg', 1, '47bbd81db1d6e94081514a623971d190', '2018-12-02 12:59:17 pm', '2018-12-06 08:19:47 am', ''),
(21, '  মোঃ রেজাউল হক  ', 'normal distribution of letters, as opposed to using \'Content here, content here\', making it look like readable English. Many desktop publishing packages and web page editors now use Lorem Ipsum as their default model text, and a search for \'lorem ipsum\' will uncover many web sites still in their infancy. Various versions have evolved over the years, sometimes by accident, sometimes on purpose (injected humour and the like).', '75302Hydrangeas.jpg', 3, 'e29de6f79588c0834dfa474c9ec6a8d9', '2018-12-06 04:54:16 am', '2018-12-06 07:11:30 am', ''),
