(4, '', '<p>\r\nIt is a long established fact that a reader will be distracted by the \r\nreadable content of a page when looking at its layout. The point of \r\nusing Lorem Ipsum is that it has a more-or-less normal distribution of \r\nletters, as opposed to using \'Content here, content here\', making it \r\nlook like readable English. Many desktop publishing packages and web \r\npage editors now use Lorem Ipsum as their default model text, and a \r\nsearch for \'lorem ipsum\' will uncover many web sites still in their \r\ninfancy. Various versions have evolved over the years, sometimes by \r\naccident, sometimes on purpose (injected humour and the like).\r\n\r\n<br></p>', '', 0, '2cefda39055fba3eaa4d8bbf3c57d60f', '2018-11-15 09:54:28 am', '', '2018-12-03 04:32:27 am'),
(5, '', 'If you are going to use a passage of Lorem Ipsum, you need to be sure \r\nthere isn\'t anything embarrassing hidden in the middle of text. All the \r\nLorem Ipsum generators on the Internet tend to repeat predefined chunks \r\nas necessary, making this the first true generator on the Internet. It \r\nuses a dictionary of over 200 Latin words, combined with a handful of \r\nmodel sentence structures, to generate Lorem Ipsum which looks \r\nreasonable. The generated Lorem Ipsum is therefore always free from \r\nrepetition, injected humour, or non-characteristic words etc.', '44988Koala.jpg', 0, 'afe3c0b2185fd6a51fb82efaeefc3258', '2018-11-17 05:24:14 am', '2018-11-17 05:28:07 am', '2018-11-17 05:28:50 am'),
(6, 'নীতীশ চন্দ্র পাল', 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', '16374rsz_picture_300.jpg', 1, '04e468b7f09dab5ae5887a5a3be5e1f0', '2018-11-21 11:25:22 am', '2018-12-03 04:31:01 am', ''),
(7, '', 'On the other hand, we denounce with righteous indignation and dislike men who are so beguiled and demoralized by the charms of pleasure of the moment, so blinded by desire, that they cannot foresee the pain and trouble that are bound to ensue; and equal blame belongs to those who fail in their duty through weakness of will, which is the same as saying through shrinking from toil and pain. These cases are perfectly simple and easy to distinguish. In a free hour, when our power of choice is untrammelled and when nothing prevents our being able to do what we like best, every pleasure is to be welcomed and every pain avoided. But in certain circumstances and owing to the claims of duty or the obligations of business it will frequently occur that pleasures have to be repudiated and annoyances accepted. The wise man therefore always holds in these matters to this principle of selection: he rejects pleasures to secure other greater pleasures, or else he endures pains to avoid worse pains', '75408Jellyfish.jpg', 1, 'de120e18daa57d1eed795d6039a74f5a', '2018-12-02 01:02:19 pm', '', '');
